import s from './bookCatalogPage.module.css';
import BookElem from './BookElem/bookElem.jsx';

const BookCatalogPage = () =>{
  return (
    <div className={s.bookCatalogPage}>
      <div className={s.searchline}>
        <input type="text" />
        <button>Search</button>
      </div>
      <div className={s.bookList}>
        <BookElem photo="https://static.wikia.nocookie.net/anime-characters-fight/images/0/00/%D0%92%D0%BE_%D0%B2%D1%81%D0%B5%D0%BE%D1%80%D1%83%D0%B6%D0%B8%D0%B8_Overgeared_%ED%85%9C%EB%B9%A8.png" details="Solo-Leveling" rating="8/10" />
        <BookElem photo="bookcover" details="Classroom of the Elite" rating="10/10" />
        <BookElem photo="bookcover" details="Overgeared" rating="8/10" />
        <BookElem photo="bookcover" details="It" rating="7/10" />
      </div>
    </div>
  );
}

export default BookCatalogPage;
